import React from 'react';
import {Box, Button } from '@mui/material';


export default function Sequance() {
  return (
    <Box display = {"flex"}>
        <Button name = "step1"></Button>
        <Button name = "step2"></Button>
        <Button name = "step3"></Button>
        <Button name = "step4"></Button>
        <Button name = "step5"></Button>

    </Box>
  )
}
